ISO8601 Format are different in MongoDB and iOS<p>I want to post a <code>Date</code> with <code>IOS8601</code> format from iOS to NodeJS(mongoDB), and get from NodeJS to iOS.</p>

<p>But the dateformat are different from both platform.</p>

<p>iOS side: <strong>2019-05-26T17:10:10Z</strong>
mongoDB side: <strong>2019-05-26T17:10:10.000Z</strong></p>

<p>which means the date example post to mongoDB, then the date get back with the extra <code>.000</code>.</p>

<p><strong>For iOS</strong>:</p>

<pre><code>extension Date {
  var ISO8601String: String? {
      let formatter = ISO8601DateFormatter()
      return formatter.string(from: self)
  }
}
</code></pre>

<p>The ISO8601String output is: <strong>YYYY-MM-ddTHH:mm:ssZ</strong> </p>

<p><strong>For mongoDB</strong></p>

<p>Schema:</p>

<pre><code>var FooSchema = Schema({

    date: {
      type: Date,
      required: true
    }
})
</code></pre>

<p>Usage:</p>

<pre><code>let date = new Date(req.body.date) // I also used req.body.date directlly
new Foo(date: date)
</code></pre>

<p>On iOS side get the ISO8601 <code>date</code> was added <code>.000</code>. 
which is <code>yyyy-MM-dd'T'HH:mm:ss.SSS'Z'</code></p>

<p>Here is the <a href="https://docs.mongodb.com/manual/reference/method/Date/" rel="nofollow noreferrer">doc reference</a>:
<a href="https://i.stack.imgur.com/9Vjj9.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/9Vjj9.png" alt="enter image description here"></a></p>

<p>Do I have to convert at least from one side?</p>

