Connection Refused error when Mongo is connected to application<p>I am writing some tests in Mocha and my first test always passes:</p>

<pre><code>const assert = require('assert');
const request = require('supertest');
const app = require('../app');

describe('The express app', () =&gt; {
  it('handles a GET request to /api', done =&gt; {
    request(app)
      .get('/api')
      .end((err, response) =&gt; {
        assert(response.body.hi === 'there');
        done();
      });
  });
});
</code></pre>

<p>But this second test always fails since its inception:</p>

<pre><code>const assert = require("assert");
const request = require("supertest");
const mongoose = require("mongoose");
const app = require("../../app");

const Driver = mongoose.model("driver");

describe("Drivers controller", () =&gt; {
  it("Post to /api/drivers create a new driver", () =&gt; {
    let oldCount;
    return Driver.count()
      .then(count =&gt; {
        oldCount = count;
        return new Promise((resolve, reject) =&gt; {
          request(app)
            .post("api/drivers")
            .send({ email: "test@test.com" })
            .end((err, res) =&gt; {
              if (err) {
                reject(err);
              } else {
                resolve(res);
              }
            });
        });
      })
      .then(() =&gt; {
        return Driver.count();
      })
      .then(newCount =&gt; {
        assert(oldCount + 1 === newCount);
      });
  });
});
</code></pre>

<p>The above is the third refactor of it and I am testing this controller:</p>

<pre><code>const Driver = require("../models/driver");

module.exports = {
  greeting(req, res) {
    res.send({ hi: "there" });
  },

  create(req, res) {
    console.log(req.body);
    const driverProps = req.body;

    Driver.create(driverProps).then(driver =&gt; res.send(driver));
  }
};
</code></pre>

<p>With the original refactor I was getting that the <code>assert(oldCount + 1 === newCount);</code> was returning <code>falsy</code> instead of <code>truthy</code> which was not expected and with the refactor of my test I get a connection refused, but the db is connected I checked with this configuration:</p>

<pre><code>const express = require("express");
const bodyParser = require("body-parser");
const mongoose = require("mongoose");
const routes = require("./routes/routes");
const app = express();

mongoose.Promise = global.Promise;
mongoose.connect("mongodb://localhost/muber", { useMongoClient: true });

const connection = mongoose.connection;

connection.on("connected", function() {
  console.log("connected to db");
});

app.use(bodyParser.json());
routes(app);

module.exports = app;
</code></pre>

<p>results in:</p>

<blockquote>
  <p>[nodemon] starting <code>mocha --recursive -R min</code>   connected to db</p>

  <p>1 passing (43ms)   1 failing</p>

  <p>1) Drivers controller Post to /api/drivers create a new driver:
       Error: ECONNREFUSED: Connection refused
        at Test.assert (node_modules/supertest/lib/test.js:164:13)
        at Server.assert (node_modules/supertest/lib/test.js:131:12)
        at emitCloseNT (net.js:1600:8)
        at processTicksAndRejections (internal/process/next_tick.js:76:17)</p>

  <p>[nodemon] app crashed - waiting for file changes before starting...</p>
</blockquote>

<p>Not sure what is going on.</p>

